import React from 'react';
import Icon from '@material-ui/core/Icon';

import styles from './Footer.module.css';

const Footer = () => {
  return(
      <div className={styles.container}>
        <div className={styles.footer}>
          <h5>&copy; Piyush-2020</h5>
          <Icon>star</Icon> 
        </div>


      </div>

  )
}

export default Footer
